// frontend/src/pages/PlannerPage.jsx
import React from 'react';
import ChatPanel from '../components/ChatPanel';
import TripVisualizer from '../components/TripVisualizer';
function PlannerPage() {
  return (
    <div className="d-flex main-content px-4" style={{ marginTop: '80px' }}>
      <div className="w-50 border-end pe-3 overflow-auto">
        <ChatPanel />
      </div>
      <div className="w-50 ps-3 overflow-auto">
        <TripVisualizer />
      </div>
    </div>
  );
}


export default PlannerPage;
